import "./Heading.css";

const Heading = () => {
  return (
    <heading className="heading">
      <div className="header_text">
        <div className="header_text__own_your_audience">Own your audience.</div>
        <div className="header_text__gradient_text">So you don't lose them</div>
      </div>
      <div className="button-text">
      <div className="button-text__heading_text">Turn your audience into email and
            text message subscribers.</div>
          <div className="button-text__buttons">
            <button>Get Started Now</button>
          </div>
         </div>
    </heading>
  );
};

export default Heading;
